sympy.sympy.external.pythonmpq.__mul__:
def __mul__(self, other):
    """q1 * q2"""
    if isinstance(other, PythonMPQ):
        ap, aq = self.numerator, self.denominator
        bp, bq = other.numerator, other.denominator
        x1 = gcd(ap, bq)
        x2 = gcd(bp, aq)
        p, q = ((ap//x1)*(bp//x2), (aq//x2)*(bq//x1))
    elif isinstance(other, int):
        x = gcd(other, self.denominator)
        p = self.numerator*(other//x)
        q = self.denominator//x
    else:
        return NotImplemented

    return self._new(p, q)

sympy.sympy.polys.domains.domain.__call_:
def __call__(self, *args) -> Er:
    """Construct an element of ``self`` domain from ``args``. """
    return self.new(*args)

sympy.sympy.polys.domains.expressiondoma:
def __mul__(f, g):
    g = f._to_ex(g)

    if g is None:
        return NotImplemented

    if EX.zero in (f, g):
        return EX.zero
    elif f.ex.is_Number and g.ex.is_Number:
        return f.__class__(f.ex*g.ex)

    return f.simplify(f.ex*g.ex)

sympy.sympy.polys.domains.gaussiandomain:
def __mul__(self, other: Self | int) -> Self:
    other_conv = self._get_xy(other)
    if other_conv is None:
        return NotImplemented
    x, y = other_conv
    return self.new(self.x*x - self.y*y, self.x*y + self.y*x)

sympy.sympy.polys.domains.modularinteger:
def __mul__(self, other):
    val = self._get_val(other)

    if val is not None:
        return self.__class__(self.val * val)
    else:
        return NotImplemented

sympy.sympy.polys.fields.__mul__:
def __mul__(f, g):
    """Multiply rational functions ``f`` and ``g``. """
    field = f.field

    if not f or not g:
        return field.zero
    elif field.is_element(g):
        return f.new(f.numer*g.numer, f.denom*g.denom)
    elif field.ring.is_element(g):
        return f.new(f.numer*g, f.denom)
    else:
        if isinstance(g, FracElement):
            if isinstance(field.domain, FractionField) and field.domain.field == g.field:
                pass
            elif isinstance(g.field.domain, FractionField) and g.field.domain.field == field:
                return g.__rmul__(f)
            else:
                return NotImplemented
        elif isinstance(g, PolyElement):
            if isinstance(field.domain, PolynomialRing) and field.domain.ring == g.ring:
                pass
            else:
                return g.__rmul__(f)

    return f.__rmul__(g)

sympy.sympy.polys.polyclasses.__mul__:
def __mul__(f, g):
    if isinstance(g, ANP):
        return f.mul(g)
    try:
        g = f.dom.convert(g)
    except CoercionFailed:
        return NotImplemented
    else:
        return f.mul_ground(g)

sympy.sympy.polys.rings.__mul__:
def __mul__(
    self, other: PolyElement[Er] | Er | int | PolyElement[PolyElement[Er]], /
) -> PolyElement[Er] | PolyElement[PolyElement[Er]]:
    """Multiply two polynomials.

    Examples
    ========

    >>> from sympy.polys.domains import QQ
    >>> from sympy.polys.rings import ring

    >>> _, x, y = ring('x, y', QQ)
    >>> p1 = x + y
    >>> p2 = x - y
    >>> p1*p2
    x**2 - y**2

    """
    if not self or not other:
        return self.ring.zero

    if self.ring.is_element(other):
        return self._mul(other)

    if isinstance(other, PolyElement):
        domain = other.ring.domain
        if isinstance(domain, PolynomialRing) and domain.ring.is_element(self):
            return cast("PolyElement[PolyElement[Er]]", other).mul_ground(self)

    res = self._try_mul_ground(other)
    if res is not NotImplemented:
        return res

    if isinstance(other, PolyElement):
        return other._try_mul_ground(self)

    return NotImplemented
